import { useParams } from "react-router-dom";
import useFetchData from "../apiFetches/FetchData";
const User = () => {
  const { user } = useParams();
  const data = useFetchData(`/users/${user}`);
  console.log(data);

  return data.loading ? <div>Loading</div> : <div>{user}</div>;
};
export default User;
